import React from 'react';
import '../styles/b';

export default function NeonButton({
  text,
  onClick,
  fullWidth = false,
  variant = 'default',
  disabled = false
}) {
  return (
    <button
      className={`neon-button ${fullWidth ? 'full-width' : ''} ${variant === 'danger' ? 'danger-button' : ''}`}
      onClick={onClick}
      disabled={disabled}
    >
      {text}
    </button>
  );
}
